import React, { useState } from 'react'
import AppBar from '@mui/material/AppBar';
import Box from '@mui/material/Box';
import CssBaseline from '@mui/material/CssBaseline';
import Divider from '@mui/material/Divider';
import Drawer from '@mui/material/Drawer';
import IconButton from '@mui/material/IconButton';
import List from '@mui/material/List';
import ListItem from '@mui/material/ListItem';
import ListItemButton from '@mui/material/ListItemButton';
import ListItemText from '@mui/material/ListItemText';
import MenuIcon from '@mui/icons-material/Menu';
import Toolbar from '@mui/material/Toolbar';
import Typography from '@mui/material/Typography';
import Button from '@mui/material/Button';
import { Link } from 'react-router-dom';
import { Collapse, Grid, InputAdornment, Popover, TextField } from '@mui/material';
import FacebookIcon from '@mui/icons-material/Facebook';
import InstagramIcon from '@mui/icons-material/Instagram';
import TwitterIcon from '@mui/icons-material/Twitter';
import Tooltip from '@mui/material/Tooltip';
import MailIcon from '@mui/icons-material/Mail';
import Menu from '@mui/material/Menu';
import KeyboardArrowDownIcon from '@mui/icons-material/KeyboardArrowDown';
import * as AdminUtil from '../../util/AdminUtil';
import SearchIcon from '@mui/icons-material/Search';
import ShoppingCartOutlinedIcon from '@mui/icons-material/ShoppingCartOutlined';
import { ExpandLess, ExpandMore } from '@mui/icons-material';

const MobileNavbar = (props) => {

    const shopOptions = AdminUtil.getDropDownForShop();
    const cafeOptions = AdminUtil.getDropDownForCafes();
    const learningOptions = AdminUtil.getDropDownForLearning();
    const aboutUsOptions = AdminUtil.getDropDownForAboutUs();

    const { window } = props;
    const [mobileOpen, setMobileOpen] = useState(false);

    const drawerWidth = props.drawerWidth;

    const handleDrawerToggle = () => {
        console.log("close drawer");
        setMobileOpen((prevState) => !prevState);
    };


  

    // Vars and functions for opening/closing Shop dropdown
    const [openShop, setOpenShop] = useState(false);

    const handleShopOpen = () => {
        setOpenShop(!openShop);
    };


    
    const drawer = (
        <Box onClick={() => handleDrawerToggle} sx={{ textAlign: 'center' }}>

            <Divider />
            <List>
            <ListItemButton onClick={handleShopOpen}>
               <ListItemText primary="Shop" />
                {openShop ? <ExpandLess /> : <ExpandMore />}
            </ListItemButton>
            <Collapse in={openShop} timeout="auto" unmountOnExit>
                <List component="div" disablePadding>
                <ListItemButton sx={{ pl: 4 }}>
                    <ListItemText primary="Starred" />
                </ListItemButton>
                </List>
            </Collapse>
      
            </List>
        </Box>
    );

    const container = window !== undefined ? () => window().document.body : undefined;    

    return (
        <Toolbar sx={{  display: { xs: 'block', sm: 'block', md: 'none' } }}>

        <IconButton
            color="inherit"
            aria-label="open drawer"
            edge="start"
            onClick={handleDrawerToggle}
            sx={{ mr: 2, display: { md: 'none' }, marginTop: '9px' }}
            >
            <MenuIcon />
            <Typography variant='h6' sx={{marginLeft: '2px', marginBottom: '2px'}}>
                Menu
            </Typography>
        </IconButton>

        <Box component="nav">
            <Drawer
                container={container}
                variant="temporary"
                open={mobileOpen}
                onClose={handleDrawerToggle}
                ModalProps={{
                keepMounted: true,
                }}
                sx={{
                display: { xs: 'block', sm: 'block', md: 'none' },
                '& .MuiDrawer-paper': { boxSizing: 'border-box', width: drawerWidth },
                }}
            >
            <TextField
                variant="standard"
                label="Search..."
                InputProps={{
                    endAdornment: (
                    <InputAdornment position="start">
                        <IconButton>
                            <SearchIcon />
                        </IconButton>
                    </InputAdornment>
                    )
                }}
            />
                {drawer}
            </Drawer>
        </Box>
        


    </Toolbar> 
    )
}

export default MobileNavbar
